import '../App.css';

const Banner = {
    textalign:"center",
    backgroundcolor:"darkcyan",
};

const Homepage = (props) => {

<div className="Banner">
    <h1>Res-happy</h1>
    <h3>Let's get cooking!</h3>
</div>

}

export default Homepage;
